import Head from "next/head";

const Meta = () => (
  <Head>
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta charSet="utf-8" />
    <link rel="stylesheet" href="//cdn.quilljs.com/1.2.6/quill.snow.css" />
  </Head>
);

export default Meta;
